import React from 'react';
//import {classes} from '../../css/Users/Users.module.css';

const Users = (props) => {
    let usersList = props.posts.map(msg => <Post message={msg.message} likes={msg.likes} key={msg.id} />);
    return (
        <div>
            {
            props.users.map( u => <div key={u.id}>
                <span>
                    <div>
                        <img src={u.photoURL} />
                    </div>
                    <div>Follow</div>
                </span>
                <span>
                    <span>
                        <div>{u.fullName}</div>
                        <div>{u.status}</div>
                    </span>
                    <span>
                        <div>{u.location.city}</div>
                        <div>{u.location.country}</div>
                    </span>
                </span>
            </div>)
            }
        </div>
    );
};

export default Users;
